import React, { useState, useEffect } from 'react';
import { Link as ScrollLink } from 'react-scroll'; // React Scroll for smooth scrolling
import AboutMe from './Aboutme'; // Import your AboutMe component
import Footer from './footer';
import './HomePage.css'; // Import your CSS file
import Contactme from './contactme';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };
    handleResize();
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  // Common Styles
  const commonStyle = {
    background: 'linear-gradient(135deg, #0D1117, #21262D)',
    color: '#C9D1D9',
    fontFamily: "'Roboto', sans-serif",
    boxSizing: 'border-box',
    paddingInlineStart: '20px',
    paddingInlineEnd: '20px',
    overflowX: 'hidden',
    marginTop:'200px'
  };

  const headerContainerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    minHeight: '30vh',
    textAlign: 'center',
    padding: '20px',
  };

  const headerStyle = {
    margin: '0 0 10px',
    color: '#58A6FF',
    fontSize: '2.5rem',
  };

  const subHeaderStyle = {
    margin: '0 0 20px',
    color: '#C9D1D9',
    fontSize: '18px',
    maxWidth: '600px',
  };

  const buttonContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '20px',
    marginTop: '20px',
  };

  const panelContainerStyle = {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    gap: '40px',
    maxWidth: '800px',
    margin: '40px auto 0',
  };

  const sidePanelStyle = {
    backgroundColor: '#21262D',
    color: '#C9D1D9',
    padding: '50px',
    borderRadius: '12px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
    transformOrigin: 'left',
    animation: 'drawBox 1s ease-in-out',
    animationDelay: '0.5s',
  };

  return (
    <div style={commonStyle}>
      {/* Header */}
      <div style={headerContainerStyle}>
        <h1 style={headerStyle}>Hi, I'm Mohammed ðŸ‘‹</h1>
        <p style={subHeaderStyle}>
          With 7 years of experience in tech, I bring passion and expertise to everything I do. 
          I specialize in creating intuitive, user-friendly applications and designing elegant solutions to complex problems. 
          Whether itâ€™s coding, gaming, or solving puzzles, I thrive on challenges.
        </p>
        <div style={buttonContainerStyle}>
          {/* Smooth scroll links */}
          <ScrollLink
            to="about-section"
            smooth={true}
            duration={500}
            className="button-style"
          >
            About Me
          </ScrollLink>

          <ScrollLink
            to="contactme-section"
            smooth={true}
            duration={500}
            className="button-style"
          >
            Contact Me
          </ScrollLink>
          <a
            href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
            download="Mohammed_Bakhshi_CV.pdf"
            target="_blank"
            rel="noopener noreferrer"
            className="button-style"
          >
            View CV
          </a>
        </div>
      </div>

      {/* Panels Section */}
      <div id="skills-section" style={panelContainerStyle}>
        {/* Interests Panel */}
        <div style={sidePanelStyle} className="draw-panel">
          <h3>Interests</h3>
          <ul style={{ textAlign: 'left', lineHeight: '1.8' }}>
            <li>Learning</li>
            <li>Going out</li>
            <li>Gaming</li>
            <li>Anime</li>
            <li>Listening to music</li>
            <li>Watching TV</li>
            <li>Puzzles</li>
          </ul>
        </div>

        {/* Technical Skills Panel */}
        <div style={sidePanelStyle} className="draw-panel">
          <h3>Technical Skills</h3>
          <ul style={{ textAlign: 'left', lineHeight: '1.8' }}>
            <li>JavaScript</li>
            <li>React.js</li>
            <li>Node.js</li>
            <li>Python</li>
            <li>SQL</li>
            <li>Selenium</li>
            <li>RESTful APIs</li>
          </ul>
        </div>
      </div>

      {/* About Section */}
      <div id="about-section" style={{ padding: '40px 0' }}>
        <AboutMe />
      </div>

      {/* Contact Section */}
      <div id="contactme-section" style={{ padding: '40px 0' }}>
        <Contactme />
      </div>

      
    </div>
  );
};

export default HomePage;
